import React from 'react';
import {createRoot} from 'react-dom/client';

const App = () => {
  return (
    <div>
      <h1>Hello, World!</h1>
    </div>
  );
}

const domNode = document.getElementById('app');
const root = createRoot(domNode);

root.render(<App />);
